;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;sketch=1;curveFitting=1;jiggle=2;labelBackgroundColor=none;fontColor=#1A1A1A;fontFamily=Shantell Sans;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DShantell%2BSans;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;145.5\&quot; y=\&quot;112\&quot; width=\&quot;300\&quot; height=\&quot;30\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;ipjx0bwvJYTSwDbXQH4O-18\&quot; value=\&quot;Début du XXe siècle, la physique a avancé, et les hypothèses d&amp;#39;Avogadro sont maintenant communément admises.&amp;lt;br&amp;gt;&amp;lt;br&amp;gt;L&amp;#39;expérience d&amp;#39;Avogadro a conduit à regrouper les atomes en paquets, ou moles. Le nombre&amp;amp;nbsp;d&amp;#39;atomes dans une mole est gigantesque.\&quot; style=\&quot;text;html=1;align=left;verticalAlign=middle;whiteSpace=wrap;rounded=0;sketch=1;curveFitting=1;jiggle=2;labelBackgroundColor=none;fontColor=#1A1A1A;fontFamily=Shantell Sans;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DShantell%2BSans;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;532.5\&quot; y=\&quot;138\&quot; width=\&quot;230\&quot; height=\&quot;100\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;ipjx0bwvJYTSwDbXQH4O-20\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;font-size: 13px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 13px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; font-weight: normal;&amp;quot;&amp;gt;Perrin recence 13 expériences permettant de mesurer le nombre d&amp;#39;atomes dans une mole d&amp;#39;atomes, donnant des résultats aux alentours de 6 x 10&amp;lt;/span&amp;gt;&amp;lt;sup style=&amp;quot;background-color: initial; font-weight: normal;&amp;quot;&amp;gt;23&amp;lt;/sup&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; font-weight: normal;&amp;quot;&amp;gt;.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/h1&amp;gt;&amp;lt;p style=&amp;quot;font-size: 13px;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 13px;&amp;quot;&amp;gt;En hommage à Avogadro, il nomme ce nombre le &amp;lt;i style=&amp;quot;&amp;quot;&amp;gt;nombre d&amp;#39;Avogadro&amp;lt;/i&amp;gt;.&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;spacing=5;spacingTop=-20;whiteSpace=wrap;overflow=hidden;rounded=0;sketch=1;curveFitting=1;jiggle=2;labelBackgroundColor=none;fontColor=#1A1A1A;fontFamily=Shantell Sans;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DShantell%2BSans;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;770.5\&quot; y=\&quot;37\&quot; width=\&quot;290\&quot; height=\&quot;120\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;ipjx0bwvJYTSwDbXQH4O-21\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;font-size: 13px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-weight: normal;&amp;quot;&amp;gt;Le nombre d&amp;#39;Avogadro est aujourd&amp;#39;hui une des constantes fondamentales de la physique. Il est rigoureusement égal à 6,022 140 76 x 10&amp;lt;sup style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;23&amp;lt;/sup&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/h1&amp;gt;\&quot; style=\&quot;text;html=1;spacing=5;spacingTop=-20;whiteSpace=wrap;overflow=hidden;rounded=0;sketch=1;curveFitting=1;jiggle=2;labelBackgroundColor=none;fontColor=#1A1A1A;fontFamily=Shantell Sans;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DShantell%2BSans;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1073.5\&quot; y=\&quot;131\&quot; width=\&quot;206.5\&quot; height=\&quot;79\&quot; as=\&quot;geomet
